INSERT INTO `tbl_c_sentence` VALUES (2, 0, 100002, 0, '               初见公司诚招聘实习生\nI Want U！\n\n初见公司诚招中大学子共同感受移动互联网浪潮，打造 OTO 模式下的消费无线\n\n消费平台。\n\n目前，我们在产品开发和研究方面，在以下几个方向上，需要一批有理想，有技\n\n术背景年轻人共同奋斗：\n\n1. 网络爬虫：基于当前的爬虫框架，编写爬虫程序，对若干网站的数据进行分\n\n析和处理\n\n2. 搜索算法：通过全文检索及逐步完善的专用知识库，实现智能识别、个性化\n\n推荐和快速查询等\n\n3. 移动客户端开发：根据市场需要，利用现有的数据，编写相应的 API 接口/SDK，\n\n并开发 APP 原型系统\n\n4. 内部业务支撑系统的开发\n\n5. 市场调研及分析\n\n\n招聘要求：\n\n1、计算机科学或相关技术学科的在读学士，硕士或博士（市场调研及分析类除\n\n外）；\n\n2、了解互联网/移动互联网的生活服务，对移动互联网有浓厚兴趣；\n\n3、拥有扎实的知识基础，实际代码编写经验；\n\n4、较好的逻辑思维分析、表达、沟通能力，要有一定的自学能力，较强的团队\n\n协作意识；\n\n另:实习表现优异者可有机会转正\n招聘流程：\n\n招收简历→面试→录取培训→项目运作\n\n\n工作时间：\n\n以项目制为标准，公司将提供统一培训与全程的技术指导。实习生可选择来公司\n\n上班，或在学校自行完成项目。\n\n\n实习薪酬：\n\n根据工作量和项目难度面议。\n\n\n截止时间：\n\n2012 年 9 月 21 日晚 12 点\n\n邮件命名方式：学校-姓名-年级。如：中山大学-张三-大三\n\n简历接收邮箱：laipj@chujian.com\n\n联系方式：020-34314201\n\n公司地址：广州市海珠区艺景路北约新街 9 号 4 楼\n\n\n以下是初见公司的一些简单介绍，供参考。\n\n初见公司的介绍\nhttp://www.chujian.com/about%20us.html\n\n无线消费平台初见获郑南雁 1000 万美元投资\nhttp://finance.sina.com.cn/chuangye/investment/20120910/095813\n091508.shtml\n\n大众点评遭遇强敌竞争：三大因素致用户易流失\nhttp://tech.sina.com.cn/i/2012-09-03/05337574979.shtml\n', '', '2012-09-21 17:42:44');
